import React from "react";
import Tour from "t"

const Tours = ({ tours }) => {
  return (
    <section>
      <div className="title">
        <h2>Ours Tours</h2>
        <div className="underline"></div>
      </div>
      <div>
        {tours.map((tour) => {
          return <Tour></Tour>;
        })}
      </div>
    </section>
  );
};

export default Tours;
